import React from 'react';
import data from './levels.json'
import Tracks from './Tracks'
import ChronoTime from './ChronoTime';



function App() {
  const value = 'World';

  const setTime = (e) => 
  {        
    alert(JSON.stringify(e));
  };


  return (
    <div>
      <h1>F1 2022 Difficulty Helper</h1>
      <div>
          <ChronoTime onChange={setTime(this.state)} />
          <Tracks data={data} />
      </div>
    </div>
  );
}

export default App;
